// import logo from "./logo.svg";
import "./App.css";
import Nav from "./components/Nav";
import { Container, Row, Col } from "./components/Grid";
import BtnBtn from "./components/Button/NavBtn";
function App() {
  return (
    <div>
      <Nav />
      <Container>
        <Row>
          <Col size="md-12">
            <h1 className="mb-3">Full Stack Web Developement</h1>
            <BtnBtn text="Projects" link="#projects" />
            <BtnBtn text="Projects" link="#contact-me" />
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
